import { Facebook, Instagram, LinkedIn, Twitter } from "@mui/icons-material";
import { Container, Grid, IconButton, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import image1 from "../../../assets/images/nphcda_logo.svg";
import image2 from "../../../assets/images/unicef_logo.svg";
import image3 from "../../../assets/images/clinton_health_logo.svg";
import image4 from "../../../assets/images/inst_human_viralogy_logo.svg";
import image5 from "../../../assets/images/tci_logo.svg";
import image6 from "../../../assets/images/who_logo.svg";

const partners = [
  { logo: image1 },
  { logo: image2 },
  { logo: image3 },
  { logo: image4 },
  { logo: image5 },
  { logo: image6 },
];

const Header = () => {
  return (
    <div
      style={{
        position: "relative",
        height: 512,
      }}
    >
      <Grid
        container
        style={{
          position: "absolute",
          top: 0,
          bottom: 0,
          left: 0,
          right: 0,
          height: 512,
        }}
      >
        <Grid
          xs={12}
          sm={6}
          md={8}
          sx={{
            backgroundColor: "white",
          }}
        >
          <div
            style={{
              height: "100%",
              display: "flex",
              flexDirection: "column",
              justifyContent: "end",
              alignItems: "stretch",
            }}
          >
            <Box
              display="flex"
              flexDirection="column"
              justifyContent={"start"}
              alignItems="start"
              sx={{ paddingX: 10 }}
            >
              <Typography
                fontSize={18}
                fontFamily="Manrope"
                fontWeight="400"
                color="#31353B"
              >
                Our Global Partners
              </Typography>
              <Box
                display="flex"
                flexDirection="row"
                justifyContent={"space-between"}
                alignItems="center"
              >
                {partners?.map((elem, index) => (
                  <img src={elem.logo} alt="" width="10%" />
                ))}
              </Box>
            </Box>
          </div>
        </Grid>
        <Grid
          xs={12}
          sm={6}
          md={4}
          sx={{
            backgroundColor: "#00B0EF",
          }}
        ></Grid>
      </Grid>

      <div
        style={{
          position: "absolute",
          top: 0,
          bottom: 0,
          left: 0,
          right: 0,
          zIndex: 100,
        }}
      >
        <div
          style={{
            width: "100%",
            height: "100%",
            display: "flex",
            flexDirection: "row",
            justifyContent: "end",
            alignItems: "center",
            position: "relative",
          }}
        >
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              justifySelf: "end",
              alignItems: "center",
              backgroundColor: "purple",
              padding: 10,
            }}
          >
            <IconButton>
              <Facebook
                sx={{
                  color: "white",
                }}
              />
            </IconButton>
            <IconButton>
              <Instagram
                sx={{
                  color: "white",
                }}
              />
            </IconButton>
            <IconButton>
              <Twitter
                sx={{
                  color: "white",
                }}
              />
            </IconButton>
            <IconButton>
              <LinkedIn
                sx={{
                  color: "white",
                }}
              />
            </IconButton>
          </div>
          <Box
            paddingX={10}
            sx={{
              position: "absolute",
              top: 75,
              right: 50,
              bottom: 75,
              left: 50,
              padding: 10,
              backgroundColor: "greenyellow",
            }}
          >
            <Grid container>
              <Grid
                item
                sm={6}
                md={6}
                display="flex"
                flexDirection={"column"}
                justifyContent={"center"}
                alignItems="start"
              >
                <Typography>OUR MANDATE</Typography>
              </Grid>
              <Grid item sm={6} md={6}></Grid>
            </Grid>
          </Box>
        </div>
      </div>
    </div>
  );
};

export default Header;
